def convert(image_path,generate_html_page=0,generate_image=1,debug=0,level=2,example=0):
    if example:
        gen_ex()
        res,new_width,new_height,level,levels,lol=data_to_ascii('./files/example_input.png',level)
        img_res="\n".join(res)
        file_res=Image.new('RGB',(round((new_width+2)*9.95),round((new_height+2)*17.7)))
        data=ImageDraw.Draw(file_res)
        data.text((1,1),img_res,fill=(255,255,255),font=ImageFont.truetype('courbd.ttf', 16))
        file_res.save(f"./files/results/example_ascii_art_level_{lol}.png")
    else:
        file_name=get_ext(path_split(image_path)[1])[0]
        res,new_width,new_height,level,levels,lol=data_to_ascii(image_path,level)
        if generate_html_page:
            font_size=1
            for i in range(levels.index(level)):font_size=font_size/2
            font_color=palette[5]
            if level==2048:font_color='lightgrey'
            html_res="<br>\n".join(res)
            with open(f"./files/results/{file_name}_ascii_art_level_{lol}.html","w+") as file:
                file_data=['<!DOCTYPE html>\n', '<html>\n', '\t<head>\n', '\t\t<meta charset="utf-8">\n', '\t\t<meta name="viewport" content="width=device-width, initial-scale=1">\n', '\t\t<title>Ascii Art</title>\n', '\t\t<style>\n', '\t\t .main{\n', '\t\t \ttext-align: center;\n', '\t\t \tbackground: black;\n', '\t\t \tline-height: [Size]vw;\n', '\t\t \tfont-family: monospace;\n', '\t\t \tfont-size: [Size]vw;\n', '\t\t \tcolor: [Color];\n', '\t\t \tborder-radius: 5.5px;\n', '\t\t }\n', '\t\t</style>\n', '\t</head>\n', '\t<body>\n', '\t\t<div class="main">\n', '[Main]\n', '\t\t</div>\n', '\t</body>\n', '</html>\n']
                temp_res=[]
                for i in range(0,len(file_data)):
                    if'[Main]'in file_data[i]:temp_res.append(file_data[i].replace('[Main]',html_res))
                    elif'[Size]'in file_data[i]:temp_res.append(file_data[i].replace('[Size]',str(font_size)))
                    elif'[Color]'in file_data[i]:temp_res.append(file_data[i].replace('[Color]',font_color))
                    else:temp_res.append(file_data[i])
                file.writelines(temp_res)
                file.close()
        if generate_image:
            img_res="\n".join(res)
            file_res=Image.new('RGB',(round((new_width+2)*9.95),round((new_height+2)*17.7)))
            data=ImageDraw.Draw(file_res)
            data.text((1,1),img_res,fill=(255,255,255),font=ImageFont.truetype('courbd.ttf', 16))
            file_res.save(f"./files/results/{file_name}_ascii_art_level_{lol}.png")
    print(red('[Debug]> ')+blue('Done'))
    
def check_file_path(file_path):
    if exists(file_path):
        spfp=file_path.split('.')
        valid_file_types=['.png','.jpg','.jpeg','.ico','.bmp']
        if get_ext(path_split(file_path)[1])[1] in valid_file_types:return 0
        else:
            print(red(f"Invalid File Type: '{spfp[len(spfp)-1]}'\n"),yellow(f"   Valid File Types: {', '.join(valid_file_types)}"))
            return 1
    else:
        print(red(f"Inexistant File: '{file_path}'"))
        return 1
def check_generater(inp):
    if inp in [1,'y','ye','yes',0,'n','no']:return 0
    else:
        print(red(f"Invalid Input: '{inp}'\n")+yellow("Available Inputs:-\n    'yes' as 1, y, ye,yes\n    'no' as 0, n, no"))
        return 1
def check_level(inp):
    try:
        if int(inp)in[1,2,3,4,5]:return 0
        else:
            print(red(f"Invalid Input: '{inp}\n'")+yellow("Available Inputs:-\n    1, 2, 3, 4, 5"))
            return 1
    except:
        print(red(f"Invalid Input: '{inp}\n'")+yellow("Available Inputs:-\n    1, 2, 3, 4, 5"))
        return 1
