class ScrollableFrame(tk.Frame):
    def __init__(self,container,*args,**kwargs):
        super().__init__(container,*args,**kwargs)
        def _on_mousewheel(event):
            self.canvas.yview_scroll(-1*(event.delta//120), 'units')
        self.canvas=tk.Canvas(self)
        scrollbar=tk.Scrollbar(self,orient='vertical',command=self.canvas.yview)
        self.init=tk.Frame(self.canvas)
        self.init.bind('<Configure>',lambda e:self.canvas.configure(scrollregion=self.canvas.bbox('all')))
        self.canvas.create_window((0,0),window=self.init,anchor='nw')
        self.canvas.configure(yscrollcommand=scrollbar.set)
        self.canvas.pack(side='left',fill='both',expand=True)
        scrollbar.pack(side='right',fill='y')
        self.canvas.bind_all('<MouseWheel>',_on_mousewheel)
    def _config(self,*args,**kwargs):
        self.canvas.config(*args,**kwargs)
