def cmd_live():
    cap=VideoCapture(1,CAP_DSHOW)
    init()
    print(red("NOTE: PRESS <CTRL>+C TO CLOSE THE SESSION"))
    wait(3)
    print('\033[1A'+'                                           '+'\033[1A')
    new_width=int([i for i in popen('mode').read().split('\n') if 'Columns:'in i][0].replace('Columns:',''))
    isstart=0
    remheight=0
    isprinted=0
    while True:
        try:
            if isstart:print('\033[1A'*remheight)
            isprinted=0
            _,frame=cap.read()
            frame=flip(frame,1)
            cv2image=cvtColor(frame,COLOR_BGR2RGBA)
            img=Image.fromarray(cv2image)
            width,height=img.size
            new_height=int((height/width)*new_width*0.55)
            img=img.resize((new_width,new_height)).convert('L')
            new_pixels=''.join([chars[pixel//25]for pixel in img.getdata()])
            kk=[new_pixels[i:i+new_width]for i in range(0,len(new_pixels),new_width)]
            remheight=len(kk)+2
            print(''.join(kk))
            isprinted=1
            isstart=1
            k=waitKey(30)&0xff
            if k==27:break
        except:
            if isprinted:print('\033[1A'*remheight)
            print(' '*(new_width*(remheight))+'\033[1A'*(remheight)+red('[Debug]> ')+blue('Session Ended'))
            break
    cap.release()
def main():
    try:
        inp=input('artskey> ').lower()
        if inp=='gui':
            gui()
        elif inp in['convert','cvt']:
            file_path=input("Path to Image: ")
            while check_file_path(file_path):file_path=input("Path to Image: ")
            level=input("ASCII Clearance Level (1-5): ")
            while check_level(level):level=input("ASCII Clearance Level (1-5): ")
            level=int(level)
            create_html=input("Generate HTML Page (yes/no): ")
            while check_generater(create_html):create_html=input("Create HTML Page (yes/no): ")
            if create_html in [1,'y','ye','yes']:create_html=1
            else:create_html=0
            create_image=input("Generate Image (yes/no): ")
            while check_generater(create_image):create_image=input("Generate Image (yes/no): ")
            if create_image in [1,'y','ye','yes']:create_image=1
            else:create_image=0
            convert(file_path,generate_html_page=create_html,generate_image=create_image,debug=0,level=int(level),example=0)
        elif inp in['ex','exam','exampl','example']:
            level=input("ASCII Clearance Level (1-5): ")
            while check_level(level):level=input("ASCII Clearance Level (1-5): ")
            convert(0,generate_html_page=0,generate_image=0,debug=0,level=int(level),example=1)
        elif inp in ['cam','camera','liv','live','live cvt','live convert','convert live']:
            cmd_live()
        elif inp in ['bye','quit','exit','off']:
            bye()
        else:
            print(red(f"Invalid Input: '{inp}'\n")+yellow("Available Commands:-\n    'gui': Starts the graphical user interface for ascii conversion\n    'convert': Starts Command line session for ascii conversion\n    'live convert','camera': Start live image To ASCII convertion (using camera)\n    'quit','exit','off': Exit ArtsKey\n    'example': Convert sample image to ASCII art"))
        main()
    except KeyboardInterrupt:bye()
init()
print(green("Available Commands:-\n    'gui': Starts the graphical user interface for ascii conversion\n    'convert': Starts Command line session for ascii conversion\n    'live convert','camera': Start live image To ASCII convertion (using camera)\n    'quit','exit','off': Exit ArtsKey\n    'example': Convert sample image to ASCII art"))
main()
